import './App.css';
import React, { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import Pricing from './components/Pricing';
function Main() {
  const scrollToPricingSection = () => {
    const pricingSection = document.getElementById('pricing-section');
    pricingSection.scrollIntoView({ behavior: 'smooth' });
  };
  useEffect(() => {
    AOS.init({
      duration: 500,
      once: true,
    });
  }, []);
  return (
    <section className="flex flex-col items-start justify-start w-[80vw] h-screen mt-24 text-white">
        <h1 className='text-6xl font-bold' data-aos="fade-up">Comprá tus Monedas</h1>
        <p className='font-bold' data-aos="fade-up" data-aos-delay="200">Seguro, confiable y rápido</p>
        <a className='p-4 text-xl font-black transition-all duration-150 bg-black rounded-lg cursor-pointer hover:scale-110 bg-opacity-40'
        >Ver Precios</a>
    </section>
  );
}

export default Main;
